import React from 'react';
import Head from 'next/head';
import AppLayout from '../components/AppLayout';

const Profile = () => (
  <>
    <Head>
      <title>프로필 | boardReact</title>
    </Head>
    <AppLayout>
      <div>Hello, Profile</div>
    </AppLayout>
  </>

);

export default Profile;
